import {  Row, Col,  } from "react-bootstrap";
import Product from "./Product";

const ProductList = (props) => {
  return (
    <Row>
      <Col>
        {props.products.map((product) => (
          <Product
            key={product.id}
            id={product.id}
            image={product.image}
            title={product.title}
            price={product.price}
            text={product.text}
          />
        ))}
      </Col>
    </Row>
  );
};

export default ProductList;
